var snow_1 = this.getObjectByName('Particle_1')
var snow_2 = this.getObjectByName('Particle_2')
var snow_3 = this.getObjectByName('Particle_3')
var snow_4 = this.getObjectByName('Particle_4')
var originals = [snow_1, snow_2, snow_3, snow_4];

var particles = [];

for(var i = 0; i < 250; i++) {
	var particle = newParticle(`particle${i}`)
	this.add(particle);
	particles.push(particle);
}

function update(event) {
	for(var i = 0; i < particles.length; i++) {

		var particle = particles[i];

		particle.userData.remainingLife -= 1;

		if(particle.userData.remainingLife <= 0) {
			var name = particle.name
			this.remove(this.getObjectByName(name))

			particle = newParticle(name)
			this.add(particle);

			particles.splice(i, 1);
			i--;
			particles.push(particle);
		} else {
			particle.position.add(particle.userData.velocity);
			if(particle.userData.remainingLife % particle.userData.opacityChange === 0) {
				particle.material.opacity -= 0.01
			}
		}
	}
}

function newParticle(name) {
	var idx = Math.floor(originals.length * Math.random())
	var particle = new THREE.Sprite(originals[idx].material.clone())
	var life = Math.round(Math.random() * 500 + 200)
	particle.userData.remainingLife = life
	particle.visible = true
	particle.userData.opacityChange = Math.round(life / 100)
	particle.name = name
	particle.userData.velocity = new THREE.Vector3(Math.random()*0.01 - 0.05, -Math.random()*0.1 - 0.05, 0)
	particle.position.add(new THREE.Vector3(Math.random()*100 - 50, Math.random()*10 + 20, Math.random()*60 - 30))
	return particle
}
